import Head from 'next/head'

function MainLayout(props) {
  return (
    <>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main>
        {props.children}
      </main>

      <footer >

      </footer>
    </>
  )
}

export default MainLayout;
